import './App.css';

import Navbar from './Navbar/Navbar.jsx';
import MainInformation from './Main-Information/MainInformation.js'
import Developer from './Developer/Developer.js';
import Footer from './Footer/Footer.js';
import SignIn from './Sign-in/SignIn.jsx';
import SignUp from './Sing-up/SignUp.jsx';
import PageNoutFound from './Page-not-found/PageNoutFound.jsx'
import Login from './Login/Login.jsx'
import Forget from './Forget-password/Password.jsx'


import './Navbar/Navbar.css';
import './Main-Information/MainInformation.css';
import   './Developer/Developer.css';
import   './Footer/Footer.css';
import './Sign-in/SignIn.css'
import './Sing-up/SignUp.css'
import './Forget-password/Password.css'


import './Page-not-found/PageNoutFound.css'
import './Login/Login.css'


function App() {
  return (


<Router>
<div>
  <Navbar />
  <Routes>
    <Route path="/" element={<Main />} />
    <Route path="/projects" element={<Projects />} />
    <Route path="/about" element={<MainAbout />} />
    <Route path="/contact" element={<Contact />} />
    <Route path="*" element={<NotFound />} />
  </Routes>
  <Footer />
</div>
</Router>
  );
}

export default App;
